import styled from 'styled-components';
export const Div0 = styled.div`
height: 70px;
width: 100%;
border-bottom: 3px solid #7c9c99;
display: flex;
overflow: hidden;
min-width: 1200px;
`
export const Divtop = styled.h1`
    font-size:30px;
    color:white;
    font-family: 'Noto Sans TC', sans-serif;
`
export const DivImg = styled.img`

`
